import './App.css';
import Expendelitem from './compenents/Expenselitem';
// import { Component } from 'react';

function  App(){
  const data=[
    {id:"el1",title:"toilet paper",amount:283,data:new Date()},
    {id:"el2",title:"new tv",amount:383,data:new Date()},
    {id:"el3",title:"car insurance",amount:483,data:new Date()},
    {id:"el4",title:"new desk",amount:583,data:new Date()}
  ]
  return (
    // <Expense></Expense>
    <div className='app'>
      <Expendelitem 
        title={data[0].title} 
        amount={data[0].amount} 
        data={data[0].data}></Expendelitem>
      <Expendelitem
        title={data[1].title} 
        amount={data[1].amount} 
        data={data[1].data}
      ></Expendelitem>
      <Expendelitem
        title={data[2].title} 
        amount={data[2].amount} 
        data={data[2].data}
      ></Expendelitem>
      <Expendelitem
        title={data[3].title} 
        amount={data[3].amount} 
        data={data[3].data}
      ></Expendelitem>
   </div>
  );

}
export default App;
